import { Box, Flex, Heading, Text, Image } from "@chakra-ui/react";
import NavBar from "../../components/Navigasi";
import Footer from "../../components/Footer";
import income from "../../assets/income.png";
import notPaid from "../../assets/outcome.png";
import alreadyPaid from "../../assets/incomeblue.png";

const IncomeInfo = () => {
  return (
    <>
      <NavBar />
      <Box bgColor={"#F5F7FA"} bgSize={"cover"} paddingTop={"100px"} minHeight={"100vh"}>
        <Box
          marginLeft={{ base: "5%", md: "10%" }}
          marginTop={"2%"}
          marginBottom={"2%"}
          bgColor={"#FFFFFF"}
          width={{ base: "90%", md: "80%" }}
          borderRadius={"2xl"}
        >
          <Flex
            direction={{ base: "column", md: "row" }}
            justifyContent={"space-between"}
            marginTop={{ base: "4", md: "8" }}
            marginLeft={{ base: "4", md: "8" }}
            marginRight={{ base: "4", md: "8" }}
          >
            {/*
              Note: Adjust the width and margin values based on your design requirements.
            */}
            <Box
              bgColor={"#F5F7FA"}
              width={{ base: "100%", md: "30%" }}
              height={{ base: "150px", md: "100px" }}
              borderRadius={"20px"}
              display={"flex"}
              marginBottom={{ base: "4", md: "0" }}
            >
              <Image src={income} width={"76px"} height={"76px"} marginTop={"10px"} marginLeft={"20px"} />
              <Box marginTop={"25px"} marginLeft={"20px"}>
                <Text fontWeight={"semibold"} fontSize={{ base: "xl", md: "2xl" }}>
                  Total Income
                </Text>
                <Text fontWeight={"medium"} fontSize={{ base: "md", md: "lg" }}>
                  XXXXXXXXXX
                </Text>
              </Box>
            </Box>

            <Box
              bgColor={"#F5F7FA"}
              width={{ base: "100%", md: "30%" }}
              height={{ base: "150px", md: "100px" }}
              borderRadius={"20px"}
              display={"flex"}
              marginBottom={{ base: "4", md: "0" }}
            >
              <Image src={notPaid} width={"76px"} height={"76px"} marginTop={"10px"} marginLeft={"20px"} />
              <Box marginTop={"25px"} marginLeft={"20px"}>
                <Text fontWeight={"semibold"} fontSize={{ base: "xl", md: "2xl" }}>
                  Not Yet Paid
                </Text>
                <Text fontWeight={"medium"} fontSize={{ base: "md", md: "lg" }}>
                  XXXXXXXXXX
                </Text>
              </Box>
            </Box>

            <Box
              bgColor={"#F5F7FA"}
              width={{ base: "100%", md: "30%" }}
              height={{ base: "150px", md: "100px" }}
              borderRadius={"20px"}
              display={"flex"}
            >
              <Image src={alreadyPaid} width={"76px"} height={"76px"} marginTop={"10px"} marginLeft={"20px"} />
              <Box marginTop={"25px"} marginLeft={"20px"}>
                <Text fontWeight={"semibold"} fontSize={{ base: "xl", md: "2xl" }}>
                  Already Paid
                </Text>
                <Text fontWeight={"medium"} fontSize={{ base: "md", md: "lg" }}>
                  XXXXXXXXXX
                </Text>
              </Box>
            </Box>
          </Flex>
        </Box>
      </Box>
      <Footer />
    </>
  );
};

export default IncomeInfo;
